import React, {useContext} from 'react';
import {OrderContext} from "../context/OrderContext";

const CurrentOrder = () => {
    const {orders, orderId} = useContext(OrderContext);
    let order = [];

    if (orderId) {
        order = orders.find(order => order.id === orderId);
    }

    return (
        <>
            {order &&
             <div>
                 Some Data: {order.id}
             </div>}
        </>
    );
}

export default CurrentOrder;
